import Head from 'next/head'
import styles from '../styles/Home.module.css'
import ScriptTag from 'react-script-tag'
import dynamic from 'next/dynamic'
/*const { JSDOM } = require( "jsdom" );
const { window } = new JSDOM( "" );
const $ = require( "jquery" )( window );*/
import Pos_tagger from '../components/functional_components/pos_tagger'
import Gallery from '../components/layout/portfolio-gallery'
import Topnav from '../components/layout/topnav'
import GalleryItem from '../components/layout/gallery-item'
import React from 'react'

const Circles = dynamic(
    () => import('../components/visuals/circles'),
    {
      ssr: false
    }
)

let key = null

let galleryElements = [
  <GalleryItem element={<Pos_tagger />} title='POS tagger' description="it'll tag the parts of speech on your shit " />,
  <GalleryItem element={<Pos_tagger />} title='POS tagger'/>
]

export default function Home() {
  return (
    <div>
      <Topnav currentPage='Portfolio'></Topnav>
      <center>
        <Circles />
        <Gallery galleryElements={galleryElements} />
      </center>
    </div>
  )
}
